import Navbar from './components/Navbar/Navbar';
import Footer from './components/Footer/Footer';

import Index from './pages/Home/Index';
class App extends Component {
  render() {
    return (
      <div>
           <BrowserRouter>
              <Topbar />
              <Navbar />

              <Index />
              <Footer />
            </BrowserRouter>
      </div>
    );
  }
}

export default App;
